import React from "react";

import classes from "./Movie.module.css";

const Movie = (props) => {
  const date = new Date(props.releaseDate);
  return (
    <li className={classes.movie}>
      <h2>{props.title}</h2>
      <h3>{date}</h3>
      <p>{props.openingText}</p>
    </li>
  );
};

export default Movie;
